sourcesContent:
FlowRouter.route('/', {
    action()
    {
        BlazeLayout.Render('MainLayout', {dashboard: "dashboard", user:"user"});
    },
});

FlowRouter.route('/presentations/:id',{
    action(params)
    {
        console.log("The ID of the presentation is: " + params.id);
    }
})
